import React from 'react';
import { Link } from 'react-router-dom';

const HomePage = () => {
    return (
        <div style={{ textAlign: 'center', marginTop: '50px' }}>
            <h1>Gesti√≥n de Productos</h1>
            <div style={{ margin: '20px' }}>
                <Link to="/products" style={{ marginRight: '20px', textDecoration: 'none', color: 'blue' }}>
                    Ver Productos
                </Link>
                <Link to="/add-product" style={{ textDecoration: 'none', color: 'blue' }}>
                    Agregar Producto
                </Link>
            </div>
        </div>
    );
};

export default HomePage;
